        window.addEventListener('WebComponentsReady', function(e) {
            var addressForm = document.getElementById("address-form");

            addressForm.states = states.reduce(function(curr, prev) {
                curr.push(prev.n);
                return curr;
            }, []);


            var state = "";
            addressForm.addEventListener("ac-address-changed", function(e) {

                //change the list of cities
                var newState = e.detail.address.state;
                if (newState != state) {

                    state = newState;
                    var selectedStates = states.filter(function(elem) {
                        return elem.n == state;
                    });

                    if (selectedStates.length > 0)
                        addressForm.cities = selectedStates[0].c.map(function(x) {
                            return x.n
                        });
                    else
                        addressForm.cities = [];
                }
            });

            document.querySelector('#validateBtn').addEventListener('click', function() {
                var isValid = addressForm.validate();
                alert("valid: " + isValid);
            });

            document.querySelector('#toggleMap').addEventListener('click', function() {
                addressForm.hideMap = false;
                console.log(addressForm.getMap());
                console.log("toggle maps");
            });


        });
    </script>
